import React from 'react';

class Cell extends React.Component {
    getColor(value) {
        return `rgb(${(value-1) * 25}, 100, 0)`;
    }

    render() {  
        const divStyle = {
            backgroundColor: this.getColor(this.props.number),
        };

        return (
            <div
                style={divStyle}
            >
                {this.props.number}
            </div>
        );
    }
}

export default Cell;
